@mariahcarey $8.5 million dollar mansion 🤯 Want to see a full video tour? Click the link in our bio 🔥 

Ultimate elegance combined with cutting edge home automation define this rare opportunity in the exclusive, gated Penwood enclave in Bedford NY. Extraordinary architectural details emanate warmth and style from the luxurious floorplan offering formal spaces, intimate gathering places, and a main floor grand master suite with an extravagant master bath. An upper-level retreat with deck and outdoor fireplace open to three bedroom suites, a professional grade gym, and theater.

